import React from "react";
import "./Toolbar.css";
import Logo from "./Logo/Logo";
import Icons from "../UI/Icons/Icons";

export default function Toolbar() {
  return (
    <div>
      <Logo />
      <h1>Tollbar</h1>
      <Icons type="search" />
      <Icons type="bag" />
    </div>
  );
}
